    public static int lengthOfLongestSubstring(String s) {
        if (s == null || s.isEmpty()) {
            return 0;
        }
        char[] charArr = s.toCharArray();
        Set<Character> allSet = new HashSet<>();
        int index = 1;
        int max = 0;
        for (char c : charArr) {
            allSet.clear();
            allSet.add(c);
            int temp = getMaxLenth(s.substring(index), allSet);
            if (temp > max) {
                max = temp;
            }
            if (index < s.length()) {
                index++;
            }
        }
        return max;
    }

    private static int getMaxLenth(String s, Set<Character> now) {
        if (s == null || s.isEmpty()) {
            return now.size();
        }
        char[] charArr = s.toCharArray();
        if (now.contains(charArr[0])) {
            return now.size();
        }
        now.add(charArr[0]);
        return getMaxLenth(s.substring(1), now);
    }
